    false,nt"url": null,nt"notes": "An operations/administrative inspection
    and biological review was conducted at the Fort Niobrara/Valentine NWR Complex (Complex)
    in July 1993.  The inspection team reported a variety of issues and concerns. Some
    are specific to Fort Niobrara/Valentine, but many are symptomatic of broader issues
    underlying most of our refuges issues that stem from insufficient funding and staff
    to meet all the demands that are placed on our field personnel.  Major issues for
    the refuge include fisheries management, fire management, grassland management,
    facilities maintenance, Scenic River Management and National Park Proposal.",nt"license_title":
